class Solution(object):    def convertToTitle(self, n):        """        :type n: int        :rtype: str        """        nums=[]        while n>0:            num=n%26            n=int((n-num)/26)            if num==0:                num=26                n-=1            nums.append(num)        ans=""        for i in range(len(nums)):            ans=chr(nums[i]+ord("A")-1)+ans        return anss=Solution()k=701print(s.convertToTitle(k))